Make embedded @ sign literal in one case where it is literal

addLoadEvent failed to pass on the Event object. Does not matter for any handlers used in Jenkins, but can break third-party frameworks. In particular mixpanel-2.1.min.js seems to detect when this mistake is made and somehow disables some Jenkins handlers, causing e.g. ‚ÄúLOADING‚Äù to stay on job config pages and breaking behavior.js (but only on Firefox). Using addEventListener/attachEvent where available also works, but this fix is a bit simpler and more general.
https://gist.github.com/1930440 would also work but again seems like overkill here.

To reproduce:
